import classes from "./../../css/Content.module.css";
import MyPosts from "./MyPosts/MyPosts";
import Posts from "./Posts/Posts";
import ProfileInfo from "./ProfileInfo";

const Profile = () => {

	let postsArr = [
		{ id: 0, message: 'Слова дауна по имени Иван.', name: 'Иван Иванов', age: '23',  countLike: 14},
		{ id: 0, message: 'Да мне похуй', name: 'Сергей Сергеев', age: 31, countLike: 23 }
	]

	return (
		<div>
			<ProfileInfo />
			<MyPosts />
			<Posts message='Слова дауна по имени Иван.'  name='Иван Иванов' age='23' countLike='14'/>
			<Posts message='Да мне похуй' name='Сергей Сергеев' age='31' countLike='23'/>
		</div>
	);
}

export default Profile;
